def userCode(arg):
	import pandas as pd

	

	# Receive cleaned data from the previous node

	

	data = arg

	

	data['created_date'] = pd.to_datetime(data['created_date'])

	

	# Extract the year from the created_date column

	data['year'] = data['created_date'].dt.year

	

	# Calculate the average number of complaints per year

	average_complaints = data.groupby('year').size().reset_index(name='average_complaints')

	

	return average_complaints
